import './App.css';
import { Header } from './Mycomponents/Header'
import { About } from './Mycomponents/About';
import { Home } from './Mycomponents/Home'; // Import the Home component
import React, { useState } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  const [chatLog, setChatLog] = useState([]);

  const clearChatLog = () => {
    setChatLog([]);
  };

  return (
    <Router>
      <Header mytitle="Placement Guidance Bot" />
      <Routes>
        <Route exact path="/" element={<Home chatLog={chatLog} setChatLog={setChatLog} />} />
        <Route exact path="/about" element={<About />} />
        <Route exact path="/new-chat" element={<Home chatLog={[]} setChatLog={setChatLog} />} /> {/* Use the Home component with a new chat log */}
      </Routes>
    </Router>
  );
}

export default App;
